import React from "react";

const Experience = () => {
  return (
    <div className="experience">
      <div>
        <h3>Développeur React JS et Node JS ( En apprentissage)</h3>
        <h3>Wild Code School</h3>
        <p>- Participation a  un hackathon  pour relever les défis de l’e-santé et la télémédecine, en partenariat avec Doctolib & Dataiku,  d'une durée de 48H ( en juin 2020 ).
- Création d'un site vitrine en équipe ( en HTML5, CSS3 et JavaScript ).</p>

      </div>
      <div>
        <h3>Gérant d'Entreprise Commerce de Détail et Restauration Collective.</h3>

      </div>
      <div>
        <h3>Gérant Commerce de Détail</h3>

      </div>
      <div>
        <h3>Réceptionniste-équipier polyvalent</h3>
      </div>
    </div>
  );
};

export default Experience;
